import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import { Grid, Hidden, Container } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer
} from './components';

makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), width: 800, 
  }
}));
const isDesktop = 0;
class PropertySearch extends Component {
  render(){
    console.log('props: ', this.props)
    if(isDesktop == 0){
      return (
        <div style={{display:'flex', overflow:'hidden', maxWidth:200, overflowX: 'hidden'}}>
          <div className={makeStyles.root} style={{maxHeight: this.props.windowHeight, overflow: 'auto', maxWidth:800}}>
              <Filter style={{padding:0}}></Filter>
              <Container style={{padding:20, width:'100%'}}>
                  <PropertyList></PropertyList>
                  <PropertyList></PropertyList>
            </Container>
          </div>
          <div style={{maxWidth:this.props.windowWidth-800, overflow:'hidden'}}>
              <MapContainer></MapContainer>
          </div>
        </div>

        );
    } else {
        return(
            <div></div>
        );
    }
  };
  }


export default windowSize(PropertySearch);
